import React from "react";
import { Col, Container, Row } from "react-bootstrap";

export default function Home() {
    return(
        <div>
            <Container>
                <Row>
                    <Col>
                        <h2>Home</h2>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
